data.value:
Механизм обработки исключений

Механизм обработки исключений Java – механизм, который позволяет во время работы программы «источнику» ошибки передать информацию о ней «получателю» для решения возникшей проблемы. Обеспечивает:
    • надежность: широкий охват всех возможных проблем функционирования программ;
    • эффективность: согласованный механизм упрощает отладку программного кода;
    • информирование: всегда известно место и характер проблемы;
    • отказоустойчивость: программный код диагностирует сам себя;
    • гибкость: возможность создания собственных исключений.

Исключение

Исключительная ситуация (исключение) – ситуация во время работы программы, при которой в текущем контексте невозможно нормальное продолжение выполнения программного кода. Для разрешения данной ситуации необходимо возбудить исключение: покинуть текущий контекст и передать (делегировать обработку) его в отдельное место программы – обработчик исключения. Примеры исключений: ArithmeticException (невозможно выполнить заданное арифметическое действие), ArrayIndexOutOfBoundsException (использование для доступа к элементу некорректного для данного массива индекса), NumberFormatException (преобразование к числу неподходящей по формату строки).

Возбуждение исключения

Состоит из двух обязательных действий:
    • создание (подготовка) объекта исключения;
    • «проброс» («выталкивание») исключения оператором throw. 
Например: if(t == null) throw new NullPointerException(); При отсутствии объекта по ссылке t возбуждается исключение NullPointerException. Выполнение программного кода в текущем контексте завершается. Обработка делегируется в другой фрагмент кода. Вся информация о возникшей проблеме передается в объекте исключения.

Перехват исключений (try)

Фрагмент кода, в котором возможно возникновение исключительной ситуации, должен быть помещен в специальный блок try:
//...
try {
 //...
 if(t == null) throw new NullPointerException();
 //...
}
//...

Перехват исключений (catch)

Код обработчиков исключений размещается после блока try. Обработка каждого вида исключения, который может быть сгенерирован в try, располагается в блоках catch:
//...
try {
 //...
}
catch(TypeExc1 exc1) {
//...
}
//...
catch(TypeExcN excN) {
//...
}
//...

Перехват исключений (catch)

В качестве параметра оператор catch принимает ссылку на объект исключения указанного типа. При возникновении исключительной ситуации механизм обработки исключений ищет первый из обработчиков, аргумент которого соответствует текущему типу исключения и выполняет его блок. Выполняется только один соответствующий типу исключения блок catch. Блок catch может отвечать за обработку исключений одного типа, но может их получать из различных источников (методов).
//...
try {
 //...
 if(t == null) throw new NullPointerException();
 //...
}
catch(NullPointerException e) {
 System.out.println("Объект t не создан");
 e.printStackTrace(System.out);
}
Вывод:
Объект t не создан
java.lang.NullPointerException
at excs.ExcExample.main(ExcExample.java:8)
Метод printStackTrace() объекта исключения выводит в указанный поток (по умолчанию System.err) последовательность вызванных методов (стек вызовов), которая привела к точке возникновения исключения. У объекта исключения есть также конструктор принимающий в качестве параметра строку с информацией о сгенерированном исключении:
TypeException(String info);
Эта строка включается в вывод информации об исключении при использовании метода
printStackTrace().
//...
try {
 //...
 if(t == null) {
 throw new NullPointerException("Объект t  не создан");
 }
//...
}
catch(NullPointerException e) {
 e.printStackTrace(System.out);
}
Вывод:
java.lang.NullPointerException: Объект t не создан
at excs.ExcExample.main(ExcExample.java:8)

Спецификация исключений

Спецификация исключений (exception specification) – синтаксис метода, используемый для указания типов исключений, которые могут быть сгенерированы во время его выполнения и не обрабатываются в его коде. Спецификация исключений является частью объявления метода, следует сразу за списком аргументов с использованием ключевого слова throws:
public static void sleep(long millis, int nanos)
 throws InterruptedException
public static InetAddress getLocalHost()
 throws UnknownHostException
При написании метода, в коде которого происходит вызоввозбуждающего исключения метода, компилятор предложит либо обработать эти исключения, либо отметить их в спецификации разрабатываемого метода. Исключения, которые проверяются (контролируется их обработка) еще на этапе компиляции, называют контролируемыми (checked). 

Стандартные исключения Java

Иерархия классов исключений:










Любое исключение в Java описывается классом
Throwable, находящийся в java.lang.
Throwable
Error Exception
VirtualMashineError RuntimeException IOException
OutOfMemoryError NullPointerException
От класса Throwable наследуются два класса: Error и Exception.
Класс Error представляет системные ошибки и ошибки времени компиляции, которые обычно не перехватываются. Обработка исключений Error не проверяется. Большинство из исключений Error сообщают о критических проблемах в работе программы и невозможности ее выполнения. Класс Exception представляет исключение “как таковое”, которое может быть возбуждено из любого метода (стандартных или пользовательских библиотек). Исключения Exception являются контролируемыми (кроме ветки классов RuntimeException). Стандартные исключения Java Класс RuntimeException и производные от него классы – группа исключений, представляющих ошибки в программе, которые не нужно перехватывать. Чаще всего являются следствием ошибки программиста:
    • непредвиденной (например, передача в метод нулевой ссылки);
    • непроверенной (например, обращение к элементам
массива по индексам, не соответствующим его размерам). Исключения RuntimeException относятся к неконтролируемым (unchecked). В спецификации таких исключений для методов нет необходимости: они возбуждаются системой времени выполнения автоматически и информация о них выводится непосредственно в System.error.

Пользовательские исключения

Одна из главных идей обработки исключений состоит в том, что имя класса исключения (тип) уже представляет характер проблемы и дает достаточно информации, чтобы предпринять действия по ее решению. Разработчик имеет возможность добавлять в имеющуюся иерархию исключений собственные типы исключений для обозначения специфических ошибок разрабатываемой программы. Чтобы создать собственный класс исключения, достаточно наследовать его от уже существующего наиболее близкого по значению (характеру ошибки) класса.
package excs;
class SimpleException extends Exception {
 public SimpleException() { }
 public SimpleException(String msg) {
 super(msg);
 }
}
public class ExcExample {
 public static void f() throws SimpleException {
 System.out.println("Возбуждаем SimpleException из f()");
 throw new SimpleException();
 }
 public static void g() throws SimpleException {
 System.out.println("Возбуждаем SimpleException из g()");
 throw new SimpleException("Создано в g()");
 }
 public static void main(String[] args) {
 try {
 f();
 }
 catch(SimpleException e) {
 e.printStackTrace(System.out);
 }
 try {
 g();
 }
 catch(SimpleException e) {
 e.printStackTrace(System.out);
 }
 }
}
Вывод:
Возбуждаем SimpleException из f()
excs.SimpleException
at excs.ExcExample.f(ExcExample.java:13)
at excs.ExcExample.main(ExcExample.java:21)
Возбуждаем SimpleException из g()
excs.SimpleException: Создано в g()
at excs.ExcExample.g(ExcExample.java:17)
at excs.ExcExample.main(ExcExample.java:27)

Блок finally

Если в программе существует необходимость всегда выполнять фрагмент кода вне зависимости от того, было ли возбуждено исключение внутри блока try, то при обработке исключений этот фрагмент помещается в блок finally. Так как для освобождения памяти в Java используется уборщик мусора, этот блок используется для возврата в первоначальное состояние таких ресурсов, как файл, сетевое соединение (потоковая передача данных), результат графического вывода или внешних операций, требующих завершения.
Блок finally
try {
 // Фрагмент кода, в котором могут возникнуть
// исключения A, B и С
}
catch(A exc) {
// Обработчик исключения A
}
catch(B exc) {
// Обработчик исключения B
}
catch(C exc) {
// Обработчик исключения C
}
finally {
// Действия, которые выполнятся в любом случае
}
Полная конструкция обработки исключения
class MyException extends Exception { }
public class FinallyWorks {
 static int count = 0;
 public static void main(String[] args) {
 while(true) {
 try {
 if(count++ == 0) throw new MyException();
 System.out.println("Нет исключения");
 }
 catch(MyException e) {
 System.out.println("MyException");
 }
 finally {
 System.out.println("В блоке finally");
 if(count == 2) break;
 }
 }
 }
}
Вывод:
MyException
В блоке finally
Нет исключения 
В блоке finally

Рекомендации по использованию исключений

Используйте исключения для того, чтобы:
    1. Обработать ошибку на текущем уровне (старайтесь не перехватывать исключения, если не знаете, как с ними поступить);
    2. Исправить проблему и снова вызвать метод, возбудивший исключение;
    3. Предпринять все необходимые действия и продолжить выполнение без повторного вызова метода;
    4. Попытаться найти альтернативный результат вместо того, который должен был бы произвести вызванный метод;
    5. Сделать все, что можно в текущем контексте, и заново возбудить это же исключение, перенаправив его на более высокий уровень;
    6. Сделать все, что можно в текущем контексте, и возбудить новое исключение, перенаправив его на более высокий уровень;
    7. Завершить работу программы;
    8. Упростить программу;
    9. Повысить уровень безопасности вашей библиотеки и программы.
